INSERT INTO destination VALUES(NULL, "Ελλάδα", "Η Ελλάδα είναι χώρα της νοτιοανατολικής Ευρώπης στο νοτιότερο άκρο της Βαλκανικής χερσονήσου.", "LOCAL", "Ελληνικά", NULL);
INSERT INTO destination VALUES(NULL, "Βουλγαρία", "Η Δημοκρατία της Βουλγαρίας είναι χώρα της νοτιοανατολικής Ευρώπης.", "ABROAD", "Βουλγαρικά", NULL);
INSERT INTO destination VALUES(NULL, "Γαλλία", "Η  Γαλλία είναι ενιαία, ημιπροεδρική δημοκρατία, της οποίας το μεγαλύτερο μέρος των εδαφών και του πληθυσμού βρίσκεται στη Δυτική Ευρώπη, αλλά που περιλαμβάνει επίσης πολλές περιοχές και εδάφη διάσπαρτα σε ολόκληρη την υφήλιο. Η συνολική έκταση της Γαλλίας, ανέρχεται σε 674.843 τ.χλμ. και έχει πληθυσμό 67.897.000 κατοίκους.", "ABROAD", "Γαλλία", NULL);
INSERT INTO destination VALUES(NULL, "Ιταλία", "Η Ιταλία, επίσημα: Ιταλική Δημοκρατία, είναι κυρίαρχο κράτος στην Ευρώπη.", "ABROAD", "Ιταλικά", NULL);
INSERT INTO destination VALUES(NULL, "Ισπανία", "Η Ισπανία, επίσημα το Βασίλειο της Ισπανίας, είναι κράτος της νότιας Ευρώπης που καταλαμβάνει το μεγαλύτερο μέρος της Ιβηρικής χερσονήσου.", "ABROAD", "Ισπανικά", NULL);
INSERT INTO destination VALUES(NULL, "Αγγλία", "Η Αγγλία είναι τμήμα του Ηνωμένου Βασιλείου, το οποίο είναι νησιωτικό κράτος βορειοδυτικά της ηπειρωτικής Ευρώπης.", "ABROAD", "Αγγλικά", NULL);
INSERT INTO destination VALUES(NULL, "Ολλανδία", "Η Ολλανδία, επίσημα Κάτω Χώρες, είναι το ευρωπαϊκό τμήμα του Βασιλείου των Κάτω Χωρών", "ABROAD", "Ολλανδικά", NULL);
INSERT INTO destination VALUES(NULL, "Τσεχία", "Η Τσεχία, επίσημη ονομασία Τσεχική Δημοκρατία, είναι χώρα στην κεντρική Ευρώπη που συνορεύει προς τα βόρεια με την Πολωνία, με τη Γερμανία στα βορειοδυτικά και τα δυτικά, την Αυστρία στα νότια και τη Σλοβακία στα ανατολικά.", "ABROAD", "Τσέχικα", NULL);
INSERT INTO destination VALUES(NULL, "Γερμανία", "Η Γερμανία, επίσημα Ομοσπονδιακή Δημοκρατία της Γερμανίας, με πληθυσμό 84.079.811 κατοίκους, είναι η δεύτερη μεγαλύτερη σε πληθυσμό χώρα της Ευρώπης, και πρώτη στην Ευρωπαϊκή Ένωση, καθώς και μία από τις σημαντικότερες βιομηχανικές και ανεπτυγμένες χώρες του κόσμου.", "ABROAD", "Γερμανικά", NULL);
INSERT INTO destination VALUES(NULL, "Ιαπωνία", "Η Ιαπωνία είναι νησιωτική χώρα της Ανατολικής Ασίας.", "ABROAD", "Ιαπωικά", NULL);
INSERT INTO destination VALUES(NULL, "Αθήνα", "Διάσημη για τους παγκοσμίου φήμης αρχαιολογικούς θησαυρούς της, η Αθήνα αποτελεί μια από τις πιο συναρπαστικές πόλεις της Ευρώπης, με πολλές και διαφορετικές πλευρές, μια συναρπαστική γαστρονομική σκηνή και νέες γειτονιές που θα λατρέψεις να ανακαλύπτεις.", "LOCAL", "Ελληνικά", 1);
INSERT INTO destination VALUES(NULL, "Θεσσαλονίκη", "Στη Βόρεια Ελλάδα, με έδρα της τη Μακεδονία, υπάρχει μια πόλη που όμοιά της δεν υπάρχει σε ολόκληρη την Ελλάδα. Μια τεράστια πολιτισμική «μαρμίτα» είναι η Θεσσαλονίκη, όπου όνειρα, ιδέες, οράματα και τάσεις κοχλάζουν υπόγεια σε μία εναλλακτική σκηνή. Μες στο πλήθος και στους δρόμους, θα διαβάσετε την ιστορία της: Θερμαϊκός κόλπος, Λευκός Πύργος, λεωφόρος Νίκης, πλατεία Αριστοτέλους, οδός Μητροπόλεως, οδός Τσιμισκή, Λαδάδικα, Αγορά Μοδιάνο, Μπιτ Παζάρ, Άνω Πόλη.", "LOCAL", "Ελληνικά", 1);
INSERT INTO destination VALUES(NULL, "Παρίσι", "Η Γαλλία είναι μια χώρα με την οποία σχεδόν κάθε ταξιδιώτης έχει μια σχέση. Υπάρχουν αμέτρητα καφέ, γραφικά χωριά και η παγκοσμίου φήμης γαστρονομία. Μερικοί έρχονται για τους μεγάλους φιλοσόφους της Γαλλίας, τους συγγραφείς και τους καλλιτέχνες, ή για να βυθιστούν σε μια από τις ομορφότερες γλώσσες του κόσμου. Και άλλοι έρχονται για την γεωγραφική ποικιλομορφία της χώρας, με τις μεγάλες ακτές, τις τεράστιες οροσειρές και τις εκπληκτικές εκτάσεις γεωργικής γης.", "ABROAD", "Γαλλικά", 3);
INSERT INTO destination VALUES(NULL, "Μπάνσκο", "Το Μπάνσκο της Βουλγαρίας αποτελεί ένα από τα διασημότερα χειμερινά θέρετρα και είναι ψηλά στη λίστα με τους αγαπημένους προορισμούς των Ελλήνων. Διαθέτει ένα από τα πιο άρτια εξοπλισμένα χιονοδρομικά κέντρα των Βαλκανίων, πράγμα που το καθιστά ιδανικό προορισμό για τους λάτρεις του σκι. Οι συνθήκες που επικρατούν στο χιονοδρομικό είναι ιδανικές ακόμα και με τεχνητό χιόνι και η αρκετά κοντινή του απόσταση από τη χώρα μας το αναδεικνύει σε περιζήτητο προορισμό. Το Μπάνσκο αποτελεί ένα γραφικό χωριό της Βουλγαρία και είναι χτισμένο στους πρόποδες της οροσειράς Pirin σε υψόμετρο 976 μέτρων. Κατά μήκος του χωριού εκτείνεται και ο ποταμός Glazne. Στα κτήρια και στα ξενοδοχεία είναι εμφανής η βαλκανική αρχιτεκτονική ωστόσο όμως πολλά οικοδομήματα είναι ακόμα υπό κατασκευή.", "ABROAD", "Βουλγάρικα", 2);
INSERT INTO destination VALUES(NULL, "Σόφια", "Περιτριγυρισμένη από ένα μεγάλο πάρκο, η Σόφια, η πρωτεύουσα και μεγαλύτερη πόλη της Βουλγαρίας, βρίσκεται στους πρόποδες του όρους Βίτοσα, δημοφιλούς προορισμού για σκι. Με ιστορία μεγαλύτερη από επτά χιλιετίες, όπως φαίνεται από τα πολλά της ερείπια, η Σόφια είναι μια από τις αρχαιότερες πόλεις της Ευρώπης. Το εθνικό ιστορικό μουσείο είναι ένα από τα πιο πλούσια της ανατολικής Ευρώπης. Πλατιές, λιθόστρωτες λεωφόροι, όμορφες μπουτίκ και πραγματικά ξέφρενη νυχτερινή ζωή πρωταγωνιστούν σ’ αυτή την πόλη των 1,3 εκατομμυρίων κατοίκων. Μπορείτε να μετακινηθείτε εύκολα στην πόλη χρησιμοποιώντας τρόλεϊ, τραμ και λεωφορεία.", "ABROAD", "Βουλγάρικα", 2);
INSERT INTO destination VALUES(NULL, "Αλεξανδρούπολη", "Με θέση κομβική, η Αλεξανδρούπολη ενώνει Ευρώπη και Ασία, Δύση και Ανατολή. Η όμορφη παραθαλλάσια πόλη, με τον φάρο να ορθώνεται επιβλητικός στο λιμάνι, αποτελεί προνομιακό κέντρο μιας πραγματικά χαρισματικής περιοχής.","LOCAL","Ελληνικά",1);
INSERT INTO destination VALUES(NULL, "Βενετία", "Η Βενετία είναι μια γοητευτική πόλη που μαγεύει τους επισκέπτες. Είναι ονειρική και ρομαντική με μια ιδέα μυστηρίου και δράματος.","ABROAD","Ιταλικά",4);
INSERT INTO destination VALUES(NULL, "Μαδρίτη", "Ακριβώς στην καρδιά της Ισπανίας, περίπου 500 χιλιόμετρα από τις ακτές της Μάλαγας, μία ηλιόλουστη, έντονη, ιστορική, πολυπολιτισμική πρωτεύουσα, ενώνει μαγευτικά τη μεσογειακή γοητεία με τις αξίες της Δύσης, τα καλλιτεχνικά αριστουργήματα από τα χρόνια της Αναγέννησης και μετά με μία τόσο ανεξάντλητη νυχτερινή ζωή που όμοια της δύσκολα θα βρείτε σε πολλά ακόμα σημεία της Ευρώπης.","ABROAD","Ισπανικά",5);
INSERT INTO destination VALUES(NULL, "Λονδίνο", "Η μεσαιωνική και βικτοριανή παράδοση του Λονδίνου συμπληρώνουν έναν πλούσιο και πολύβουο σύγχρονο κόσμο.","ABROAD","Αγγλικά",6);
INSERT INTO destination VALUES(NULL, "Ρώμη", "Η ατέλειωτη Ρώμη παραμένει μια από τις πιο σημαντικές πόλεις στον κόσμο, χάρη στον μοναδικό συνδυασμό του αρχαίου κόσμου και των σύγχρονων απολαύσεων.", "ABROAD", "Ιταλικά",4);
INSERT INTO destination VALUES(NULL, "Άμστερνταμ", "Από τα γραφικά κανάλια και τις γέφυρες μέχρι τις ιστορικές κατοικίες του, το Άμστερνταμ είναι μια πραγματικά παραμυθένια πόλη.", "ABROAD", "Ολλανδικά",7);
INSERT INTO destination VALUES(NULL, "Πράγα", "Σε οποιοδήποτε σημείο της Πράγας και αν βρεθείτε, σίγουρα θα αντικρίσετε κάποιο από τα εντυπωσιακά αξιοθέατα της ή ένα περίτεχνο οικοδόμημα, το οποίο θα σας ταξιδέψει στο παρελθόν. ","ABROAD", "Τσέχικα", 8);
INSERT INTO destination VALUES(NULL, "Βερολίνο", "Μια κοσμοπολίτικη πόλη με χαρακτήρα.Από τη μόδα μέχρι την αρχιτεκτονική του και την πολιτική ιστορία του, το Βερολίνο ήταν πάντα προχωρημένο. ","ABROAD", "Γερμανικά", 9);
INSERT INTO destination VALUES(NULL, "Μυτιλήνη","Φυσική, ρομαντική, νοσταλγική αύρα εκπέμπει αυτός ο οξύκαρπος και γόνιμος τόπος, όχι μόνο για τα γήινα και τα φυσικά, αλλά και για τα μεταφυσικά της, τους στοχαστές και καλλιτέχνες που άνδρωσε κι ενέπνευσε ανά τους αιώνες.", "LOCAL","Ελληνικά",1);
INSERT INTO destination VALUES(NULL, "Χίος","Η Χίος είναι ένα νησί του Βορείου Αιγαίου που διατηρεί αναλλοίωτη την ομορφιά του. Φημίζεται για τη μαστίχα, τα μεσαιωνικά χωριά, τις πανέμορφες παραλίες, και τον εύφορο κάμπο της.","LOCAL","Ελληνικά",1);
INSERT INTO destination VALUES(NULL, "Λήμνος", "Χωριά-αριστουργήματα φτιαγμένα από πέτρα, κάστρα, αξιοθέατα, αρχαϊκά μυστήρια, αλλά και μοναδικά προϊόντα της ηφαιστειακής γης.","LOCAL","Ελληνικά",1);
INSERT INTO destination VALUES(NULL, "Σάμος","Σε αυτό το καταπράσινο νησί στην άκρη του Αιγαίου ανάμεσα σε πευκοδάση και ελαιώνες, σε εκτάσεις με εσπεριδοειδή και εύφορους αμπελώνες, θα ανακαλύψετε μύθους και ιστορικές αλήθειες.","LOCAL","Ελληνικά",1);
INSERT INTO destination VALUES(NULL, "Οινούσσες", "Οι Οινούσσες είναι μια συστάδα πανέμορφων νησιών του Βορείου Αιγαίου. Φημίζονται για την ήσυχη και φιλόξενη ατμόσφαιρα, τις υπέροχες παραλίες με τα καταγάλανα νερά, τα εντυπωσιακά φυσικά τοπία και τη ναυτική τους παράδοση. ", "LOCAL","Ελληνικά",1);
INSERT INTO destination VALUES(NULL, "Τόκιο", "Αυτή η τεράστια και πολύπλευρη πόλη είναι διάσημη για την πρωτοπορία της, όμως οι αρχαίοι βουδιστικοί ναοί, τα εκλεκτής ποιότητας καταστήματα με τσάι και οι γαλήνιοι κήποι της προσφέρουν μια ήρεμη απόδραση — και αποτελούν μια καίρια υπενθύμιση της μακράς ιστορίας της πόλης.", "ABROAD","Ιαπωνικά",10);
INSERT INTO destination VALUES(NULL, "Βαρκελώνη","Δεν υπάρχει άλλο μέρος στον κόσμο σαν τη Βαρκελώνη. Το πρωί βόλτες στη Γοτθική Συνοικία, το απόγευμα στην παραλία και τη νύχτα διασκέδαση μέχρι την αυγή. Η πόλη είναι σαγηνευτική.", "ABROAD", "Ισπανικά",5);
INSERT INTO destination VALUES(NULL, "Τρίκαλα", "Τα Τρίκαλα, πρωτεύουσα του ομώνυμου νομού, είναι μια όμορφη πόλη χτισμένη στη θέση της αρχαίας Τρίκκης (σύμφωνα με τη μυθολογία, η νύμφη Τρίκκη ήταν κόρη του Πηνειού) και πατρίδα του περίφημου γιατρού της αρχαιότητας, Ασκληπιού.", "LOCAL", "Ελληνικά", 1);
INSERT INTO destination VALUES(NULL, "Βόλος", "Ο Βόλος, μία από τις μεγαλύτερες και ομορφότερες ελληνικές πόλεις και ένα από τα σημαντικότερα λιμάνια της χώρας, βρίσκεται στο κέντρο της Ελλάδας. Χτισμένο στον μυχό του Παγασητικού κόλπου και σε απόσταση αναπνοής από το βουνό του Πηλίου, συνδυάζει όλη τη γοητεία της θάλασσας με τη μυστηριακή ομορφιά του βουνού των Κενταύρων. Η όμορφη πόλη συνδέεται με την περίφημη Αργοναυτική Εκστρατεία, ένα από τα σημαντικότερα έπη του ελληνικού μυθολογικού κύκλου.", "LOCAL", "Ελληνικά", 1);
INSERT INTO destination VALUES(NULL, "Ξάνθη", "Αμφιθεατρικά χτισμένη στους πρόποδες της οροσειράς της Ροδόπης, η Ξάνθη αποτελεί το στολίδι της Θράκης, του μοναδικού αυτού μέρους της Ελλάδας που συνδέει την Μαύρη Θάλασσα με το Αιγαίο και την Ευρώπη με την Ασία.", "LOCAL", "Ελληνικά", 1);
INSERT INTO destination VALUES(NULL, "Ξάνθη", "Αμφιθεατρικά χτισμένη στους πρόποδες της οροσειράς της Ροδόπης, η Ξάνθη αποτελεί το στολίδι της Θράκης, του μοναδικού αυτού μέρους της Ελλάδας που συνδέει την Μαύρη Θάλασσα με το Αιγαίο και την Ευρώπη με την Ασία.", "LOCAL", "Ελληνικά", 1);
INSERT INTO destination VALUES(NULL, "Καβάλα", "Χτισμένη αμφιθεατρικά κατά μήκος της θάλασσας, στο σταυροδρόμι Ανατολής και Δύσης, η Καβάλα συνδυάζει όλα όσα μπορούν να σας συγκινήσουν, όποια εποχή κι αν επιλέξετε να την επισκεφθείτε. Βουνό και θάλασσα, γραφικότητα και σύγχρονη ζωή, αρχαιολογικές περιηγήσεις, συναρπαστικές εκδρομές, πολιτιστική δράση και ηρεμία μέσα στη φύση... Όλα αυτά είναι η Καβάλα! Αναπνέοντας στους ρυθμούς της ιστορίας της, σας καλεί να ανακαλύψετε κρυμμένους θησαυρούς στα μνημεία, τα αξιοθέατα και τις καπναποθήκες της. Μαγευτικές γωνιές με κτίσματα-κοσμήματα του αστικού τοπίου, δρόμοι και στενά ολόκληρα που θα σας μεταφέρουν σε άλλη εποχή, εικόνες που ξεπήδησαν μέσα από καρτ-ποστάλ.", "LOCAL", "Ελληνικά", 1);
INSERT INTO destination VALUES(NULL, "Καβάλα", "Χτισμένη αμφιθεατρικά κατά μήκος της θάλασσας, στο σταυροδρόμι Ανατολής και Δύσης, η Καβάλα συνδυάζει όλα όσα μπορούν να σας συγκινήσουν, όποια εποχή κι αν επιλέξετε να την επισκεφθείτε. Βουνό και θάλασσα, γραφικότητα και σύγχρονη ζωή, αρχαιολογικές περιηγήσεις, συναρπαστικές εκδρομές, πολιτιστική δράση και ηρεμία μέσα στη φύση... Όλα αυτά είναι η Καβάλα! Αναπνέοντας στους ρυθμούς της ιστορίας της, σας καλεί να ανακαλύψετε κρυμμένους θησαυρούς στα μνημεία, τα αξιοθέατα και τις καπναποθήκες της. Μαγευτικές γωνιές με κτίσματα-κοσμήματα του αστικού τοπίου, δρόμοι και στενά ολόκληρα που θα σας μεταφέρουν σε άλλη εποχή, εικόνες που ξεπήδησαν μέσα από καρτ-ποστάλ.", "LOCAL", "Ελληνικά", 1);
